import i18n from "i18next";
import { initReactI18next } from "react-i18next"; 
import LanguageLocator from 'i18next-browser-languagedetector';
import backEnd from "i18next-http-backend"
i18n
.use(initReactI18next)
.use(backEnd)
.use(LanguageLocator)
.init({
    debugger:true,
    fallBackLang:"en"
})
i18
export default i18n
